import React, { Component } from 'react';
import Button from 'react-bootstrap/Button';

class Heading extends Component {
    render() { 
        return ( 
            <div>
                <img src={teamLogoImg} style={imageStyle}></img>
                <form>
                    <input type="text" name="searchBox" id="searchBox" placeholder="Search...."></input>
                    <Button variant="info" size="lg" style={buttonStyle}></Button>
                </form>
            </div>
         );
    }
}
const imageStyle = {
    float: "left",
    width : "20px",
    height : "20px"
};
const buttonStyle = {
    width : "20%",
    height : "10%"
};
const teamLogoImg = require('./teamLogoImg.jpg');
export default Heading;
